import ReactDom from "react-dom/client";
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Lab7 from "./Lab7/page";


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        <Route path="/lab7" element={<Lab7 />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
